import React from "react";

const arithmeticTopics = [
  "Problems on Trains",
  "Simple Interest",
  "Percentage",
  "Average",
  "Numbers",
  "Simplification",
  "Chain Rule",
  "Logarithm",
  "True Discount",
  "Time and Distance",
  "Compound Interest",
  "Problems on Ages",
  "Problems on Numbers",
  "Square Root and Cube Root",
  "Pipes and Cistern",
  "Races and Games",
  "Banker’s Discount"
];

const Arithmetic = () => {
  return (
    <div className="p-6 max-w-4xl mx-auto">
      <h1 className="text-2xl font-bold mb-4">Arithmetic Topics</h1>
      <div className="grid grid-cols-2 md:grid-cols-3 gap-4">
        {arithmeticTopics.map((topic, index) => (
          <div
            key={index}
            className="flex flex-col items-center p-3 border rounded-lg shadow hover:bg-gray-100 cursor-pointer"
          >
            <img
              src="https://via.placeholder.com/100" 
              alt="Folder Icon"
              className="mb-2"
            />
            <span>{topic}</span>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Arithmetic;
